import React from 'react';
import { Link } from 'react-router-dom';
import { Particles } from 'react-particles-js';

const Landing =() => {
    return (
        <div>
            <Particles 
                params={{
                    polygon: {
                        enable: true,
                        type: 'inside',
                        move: {
                            radius: 10
                        },
                        url: 'path/to/svg.svg'
                    }
                }} />



        <Link  to={`/join`} >
        <button type = "submit">Click here</button>
        </Link>
        </div>
    );
}

export default Landing;
